YUI.add("autocomplete-highlighters-accentfold",function(C){var A=C.Highlight,B=C.Array;C.mix(C.namespace("AutoCompleteHighlighters"),{charMatchFold:function(F,E){var D=B.unique(F.split(""));return B.map(E,function(G){return A.allFold(G.text,D);});},phraseMatchFold:function(E,D){return B.map(D,function(F){return A.allFold(F.text,[E]);});},startsWithFold:function(E,D){return B.map(D,function(F){return A.allFold(F.text,[E],{startsWith:true});});},wordMatchFold:function(E,D){return B.map(D,function(F){return A.wordsFold(F.text,E);});}});},"@VERSION@",{requires:["array-extras","highlight-accentfold"]});